import React from 'react';
import '../../App.js'
import HeroSection from '../heroSection'
import Cards from '../Cards'
import Footer from '../Footer.js';

function Home () {
    return (
    <>
        <HeroSection />
        <Cards />
        <Footer />
    </>
    );
}

export default Home;
